import React from 'react';
import styles from './navbar.module.css';
import { Link } from 'react-scroll';

const navlinks = [
    {
        name: 'Contact',
        link: 'mycontact'
    },
    {
        name: 'Projects',
        link: 'myprojects'
    },
    {
        name: 'Skills',
        link: 'myskills'
    },
    {
        name: 'Services',
        link: 'myservices'
    },
    {
        name: 'About',
        link: 'herosection'
    },
    {
        name: 'Home',
        link: ''
    },
]

const Links = () => {

    return (

        navlinks.map((navlink, index) =>
            <Link 
            key={index} 
            activeClass="active" 
            to={navlink.link}
            spy={true} 
            smooth={true} 
            offset={-195} 
            duration={500}
            >
            {navlink.name}
            </Link>
        )
    )
}

const navIconClick = () => {
    const elementDisplay = document.getElementById('navbar_collapse').style.display;
    if(elementDisplay==='none'){
        document.getElementById('navbar_collapse').style.display = 'block';
    }else{
        document.getElementById('navbar_collapse').style.display = 'none';
    }
}

const Navbar = () => {


    return (
        <>
        <div className={styles.navbar} id='navbar'>
            <p>MyFolio</p>
            <Links/>
            <i className="fa-solid fa-bars" onClick={navIconClick}></i>
        </div>
        <div className={styles.navbar_collapse} id='navbar_collapse'>
            <Links/>
        </div>
        </>
    );
}

export default Navbar;
